import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import * as serviceWorker from './serviceWorker';
import "tachyons";
import RoboCard from "./RoboCard";
import {robots} from "./robots";

ReactDOM.render(<App />,
  document.getElementById('root')
);
